import { MarkerMap } from '../../components/map/map';
import { RxMagnifyingGlass } from 'react-icons/rx';
import './pickUpPage.css';

export function PickUpPage() {
    return(
        <div className="content">
            <div className="where">
                <RxMagnifyingGlass size={10}/>
                <input className="search" placeholder="Donde te recojo?"/>
            </div>
            <MarkerMap/>
            <div className="timer">
                <label>Hora de recogida:</label>
                <input type="time" id="timePicker" name="time" required/>
            </div>
            <button className="confirm">Pedir servicio</button>
        </div>
    );
}
